import { createApp } from 'vue'
import App from './App'
import components from "@/components/UI"
import router from "@/router/router"; //this peas of щит на роутере просто решил что он не будет работать по причине (причина), я просто отрыл и потупил в файл и он внезапно заработал  га3кгатугкшапигшрапкгнарпгарк1398а31й89г49
import VIntersection from "@/directives/VIntersection"
import directives from '@/directives';
import store from '@/store';

const app = createApp(App)

components.forEach(component => {
    app.component(component.name,component) 
})

directives.forEach(directive => {
    app.directive(directive.name,directive)
})



app.use(router).use(store).mount('#app')
